const canvas = document.getElementById("canvas1")
const context = canvas.getContext("2d")
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;

// Array to store each particle as object
particleArr = []

// Mouse obj with radius property to interact with the particles
let mouse = {
    x: null,
    y: null,
    radius : 100
}

window.addEventListener('mousemove', (e) => {
    mouse.x = e.x + canvas.clientLeft
    mouse.y = e.y + canvas.clientTop
});

// function to generate image
function drawImage() {
    let imageWidth = png.width || png.naturalWidth;
    let imageHeight = png.height || png.naturalHeight;

    // store pixcel info from canvas based on image height and width in data
    const data =  context.getImageData(0, 0 , imageWidth, imageHeight)

    context.clearRect(0, 0, canvas.width, canvas.height)


// To construct particles with few properties
class Particle {
    constructor(x, y , color, size) {
        this.x = x + canvas.width - png.width
        this.y = y + canvas.height/2 - png.height
        this.color = color
        this.size = 2
        // base properties for each particle
        this.baseX =  x + canvas.width / 2 - png.width * 2 
        this.baseY =  y + canvas.height / 2 - png.height * 2
        // min to max ( 2 to 12 )
        this.density = Math.random() * 10 + 2
    }
    // draw function to be called for every frame for each particle
    draw() {
        context.beginPath()
        context.fillRect(this.x, this.y, this.size * 3, this.size * 3)
        context.closePath()
        context.fill()
    }
    // update function to be called for every frame of animation
    // this is to constantly calculate particle movements and mouse interaction
    update() {
        context.fillStyle = this.color

        let deltaX = mouse.x - this.x
        let deltaY = mouse.y - this.y
        let distance = Math.sqrt(deltaX * deltaX + deltaY * deltaY)
        let forceDirectionX = deltaX / distance
        let forceDirectionY = deltaY / distance
        
        var maxDistance = 100
        let force = (maxDistance - distance) / maxDistance
        
        if (force < 0) force = 0

        let directionX = forceDirectionX * force * this.density
        let directionY = forceDirectionY * force * this.density

        // Collision Detection
        if (distance < mouse.radius + this.size) {
            // Particle bounce away based on X and Y
            this.x -= directionX
            this.y -= directionY
        } else {
            if (this.x !== this.baseX) {
                deltaX = this.x - this.baseX
                this.x -= deltaX / 20
                // speed up if particle not yet return to initial position
            } if (this.y !== this.baseY) {
                let dx = this.x - this.baseX;
                let dy = this.y - this.baseY;
                this.y -= dy/5;
            }
        }
        this.draw();
    }
}

function init(){
    particleArray = [];

    for (var y = 0, y2 = data.height; y < y2; y++) {
        for (var x = 0, x2 = data.width; x < x2; x++) {
            if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 128) {
                let positionX = x;
                let positionY = y;
                let color = "rgb("+data.data[(y * 4 * data.width)+ (x * 4)]+","+data.data[(y * 4 * data.width)+ (x * 4) +1]+","+data.data[(y * 4 * data.width)+ (x * 4) +2]+")";

                particleArray.push(new Particle(positionX*4, positionY*4, color));

            }
        }
    }
    
}
function animate(){
    requestAnimationFrame(animate);
    context.fillStyle = 'rgba(255,255,255,.1)';
    context.fillRect(0,0,innerWidth,innerHeight);
    

    for (let i = 0; i < particleArray.length; i++){
        particleArray[i].update();
    }
}
init();
animate();

window.addEventListener('resize',
function(){
    canvas.width = innerWidth;
    canvas.height =  innerHeight;
    init();
});
}


var png = new Image();
png.src = "data:image/png;base64,"   
        
window.addEventListener('load', (e) => {
    
    context.drawImage(png, 0, 0);
    drawImage();
});